import React from "react";
import ReactDOM from "react-dom";
import {useState} from "react";

function newNote() {
  return (
    <div className="note">
    <form >
    <textarea id="inputTitle" placeHolder="Click to add Title"/>
    <textarea type="text" id="inputContent" placeHolder="Click to add Content"/>
    </form>
    <button type="button" class="note">Make Note</ button>
    </div>
  );
}
export default newNote;
